import React from "react";
import './style/Backstage.css'
import Stream from './Stream';

function BackstagePage(){
  var position1 = false;
  var position2 = false;
  var position3 = false;
  var position4 = false;


  function togglePosition1(){
    position1 = !position1;
  };

  function togglePosition2() {
    position2 = !position2;
  };

  function togglePosition3() {
    position3 = !position3;
  };

  function togglePosition4() {
    position4 = !position4;
  };

  return(
      <div className="Backstage">
          <h4>BACKSTAGE</h4>
          <Stream  />

      </div>
  );
}

export default BackstagePage
